import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";

import { Rasp } from "../components/Rasp/index";
import { Time } from "../components/Time";
import { Predmet } from "../components/Predmet";
import { Group } from "../components/Group";
import { Teacher } from "../components/Teachers";

import { fetchRasps } from "../redux/slices/rasps";
import { fetchTimes } from "../redux/slices/times";
import { fetchPredmets } from "../redux/slices/predmets";
import { fetchGroups } from "../redux/slices/groups";
import { fetchTeachers } from "../redux/slices/teachers";

export const Home = () => {
  const dispatch = useDispatch();
  const userData = useSelector((state) => state.auth.data);
  const { rasps } = useSelector((state) => state.rasps);

  const { groups } = useSelector((state) => state.groups);
  const { teachers } = useSelector((state) => state.teachers);

  const isGroupsLoading = groups.status === "loading";
  const isTeachersLoading = teachers.status === "loading";
  const [selectedTab, setSelectedTab] = useState(0);
  const [selectedFilter, setSelectedFilter] = useState("");

  useEffect(() => {
    dispatch(fetchRasps());
    dispatch(fetchTimes());
    dispatch(fetchPredmets());
    dispatch(fetchGroups());
    dispatch(fetchTeachers());
  }, []);

  const handleTabChange = (event, newValue) => {
    setSelectedTab(newValue);
  };

  const handleFilterChange = (event) => {
    setSelectedFilter(event.target.value);
  };

  const filteredItems = () => {
    switch (selectedTab) {
      case 0:
        return rasps.items.filter((rasp) => {
          // Filtreleme işlemleri
          // Örneğin, selectedFilter'e göre filtreleme yapabilirsiniz
          return true; // Geçici olarak true döndürüyoruz, gerçek filtreleme mantığını buraya ekleyin
        });
      case 1:
        // Diğer sekmeler için benzer şekilde filtreleme işlemlerini yapabilirsiniz
        return [];
      default:
        return [];
    }
  };

  return (
    <>
      <Tabs
        style={{ marginBottom: 15 }}
        value={selectedTab}
        onChange={handleTabChange}
        aria-label="basic tabs example"
      >
        <Tab label="Расписания" />
        <Tab label="Время" />
        <Tab label="Предмет" />
        <Tab label="Группа" />
        <Tab label="Препод" />
      </Tabs>

      <div>
        {selectedTab === 0 && (
          <>
            <div>
              <label htmlFor="filter">Filtrele:</label>
              <select id="filter" onChange={handleFilterChange}>
                {/* Filtre seçeneklerini buraya ekleyin */}
                <option value="">Tümü</option>
                <option value="filter1">Filtre 1</option>
                <option value="filter2">Filtre 2</option>
              </select>
            </div>
            <table>
              <thead>
                <tr>
                  <th>Time</th>
                  <th>Day</th>
                  <th>Predmet</th>
                  <th>Group</th>
                  <th>Teacher</th>
                  <th>Kurs</th>
                  <th>Room</th>
                </tr>
              </thead>
              <tbody>
                {filteredItems().map((obj) => (
                  <Rasp
                    key={obj._id}
                    id={obj._id}
                    time={obj.time.time}
                    day={obj.day.day}
                    predmet={obj.predmet.predmet}
                    group={obj.group.group}
                    teacher={obj.teacher.teacher}
                    kurs={obj.group.kurs.kurs}
                    room={obj.room}
                    isEditable={userData?._id === obj.user._id}
                  />
                ))}
              </tbody>
            </table>
          </>
        )} 
    {selectedTab === 3 && (
      <table>
        <thead>
          <tr>
            <th>Группа</th>
            <th>Куср</th>

          </tr>
        </thead>
        <tbody>
          {isGroupsLoading ? (
            [...Array(50)].map((_, index) => (
              <Rasp key={index} isLoading={true} />
            ))
          ) : (
            groups.items.map((gr) => (
              <Group
                key={gr._id}
                id={gr._id}
                group={gr.group}
                kurs={gr.kurs.kurs}
                isEditable={userData?._id === gr.user._id}
              />
            ))
          )}

        </tbody>
      </table>
    )}
    {selectedTab === 4 && (
      <table>
        <thead>
          <tr>
            <th>ФИО</th>
          </tr>
        </thead>
        <tbody>
          {isTeachersLoading ? (
            [...Array(50)].map((_, index) => (
              <Rasp key={index} isLoading={true} />
            ))
          ) : (
            teachers.items.map((tea) => (
              <Teacher
                key={tea._id}
                id={tea._id}
                teacher={tea.teacher}
                isEditable={userData?._id === tea.user._id}
              />
            ))
          )}

        </tbody>
      </table>
    )}
  </div>

    </>
  );
};
